  Here we have added an element to the head section and two elements to the body section.

  ```
  <!DOCTYPE html>
  <html>
      <head>
          <title>Page Title</title>
      </head>

      <body>
          <h1>My First Heading</h1>
          <p>My first paragraph.</p>
      </body>
  </html>
  ```

  ## \<title>Page Title\</title>

  The title tag is a required element in the head section of your web page. Think carefully about what your website title will be as this is the title that will appear in the tab of the browser that is displaying your web page and saved as the title if your page is bookmarked! This title is also used by search engines, so make sure it is relevant to your page content.

